import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Dashboard = ({ user, setUser }) => {
  const [allUsers, setAllUsers] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    if (user.role === 'ADMIN') {
      fetchAdminData();
    }
  }, [user.role]);

  const fetchAdminData = async () => {
    try {
      const res = await axios.get('http://localhost:3000/api/admin/users');
      setAllUsers(res.data);
    } catch (err) { console.error("Gagal ambil data admin"); }
  };

  const generateKey = async () => {
    try {
      const res = await axios.post('http://localhost:3000/api/generate-key', { userId: user.id });
      const updatedUser = { ...user, api_key: res.data.api_key };
      localStorage.setItem('user', JSON.stringify(updatedUser));
      setUser(updatedUser);
      alert("API Key Baru Berhasil Dibuat!");
    } catch (err) { alert("Gagal generate key"); }
  };

  const logout = () => {
    localStorage.removeItem('user');
    setUser(null);
    navigate('/login');
  };

  return (
    <div style={{ padding: '40px', maxWidth: '900px', margin: 'auto' }}>
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <h1>Dashboard {user.role}</h1>
        <button onClick={logout} style={{ background: 'none', border: 'none', cursor: 'pointer', textDecoration: 'underline' }}>Logout</button>
      </div>
      
      <p>Selamat datang kembali, <strong>{user.username}</strong>!</p>

      {user.role === 'USER' ? (
        <div style={cardStyle}>
          <h3>Akses API Resep</h3>
          <p>Gunakan key ini untuk mencari resep di halaman explorer.</p>
          <div style={keyBox}>{user.api_key || 'Belum ada API Key'}</div>
          <button onClick={generateKey} style={btnStyle}>GENERATE NEW KEY</button>
          <button onClick={() => navigate('/recipes')} style={{ ...btnStyle, background: '#E8D1C5', color: '#452829', marginTop: '10px' }}>
            BUKA EXPLORER RESEP â†’
          </button>
        </div>
      ) : (
        <div style={cardStyle}>
          <h3>Monitoring Data User</h3>
          <table style={tableStyle}>
            <thead>
              <tr style={{ background: '#452829', color: 'white' }}>
                <th style={tdStyle}>Username</th>
                <th style={tdStyle}>Email</th>
                <th style={tdStyle}>API Key</th>
              </tr>
            </thead>
            <tbody>
              {allUsers.map(u => (
                <tr key={u.id}>
                  <td style={tdStyle}>{u.username}</td>
                  <td style={tdStyle}>{u.email}</td>
                  <td style={tdStyle}>{u.api_key || '-'}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

const cardStyle = { background: 'white', padding: '25px', borderRadius: '15px', border: '1px solid #E8D1C5', marginTop: '20px' };
const keyBox = { background: '#F3E8DF', padding: '15px', borderRadius: '8px', textAlign: 'center', fontWeight: 'bold', margin: '15px 0', fontFamily: 'monospace' };
const btnStyle = { width: '100%', padding: '12px', background: '#452829', color: 'white', border: 'none', borderRadius: '8px', cursor: 'pointer', fontWeight: 'bold' };
const tableStyle = { width: '100%', borderCollapse: 'collapse', marginTop: '10px' };
const tdStyle = { border: '1px solid #E8D1C5', padding: '10px' };

export default Dashboard;
